import React from "react";

const List = ({ picData }) => {
  const onClick = (e) => {
    console.log(e.target.value);
  };
  return (
    <section className="list">
      <ul>
        LIST
        {picData.map((el) => {
          return (
            <>
              <li key={el.id}>{el.date}</li>
              <button onClick={onClick}>{el.date}</button>
            </>
          );
        })}
      </ul>
    </section>
  );
};

export default List;
